IF NOT EXISTS (
    select * from sysobjects where name='ol' and xtype='U'
) CREATE TABLE [ol] (
    [City] NVARCHAR(7),
    [Edition] INT,
    [Sport] NVARCHAR(17),
    [Discipline] NVARCHAR(15),
    [Athlete] NVARCHAR(33),
    [NOC] NVARCHAR(3),
    [Gender] NVARCHAR(5),
    [Event] NVARCHAR(38),
    [Event_gender] NVARCHAR(1),
    [Medal] NVARCHAR(6)
);
